import React from 'react';
import ReactDOM from 'react-dom';
import 'index.css'
//1、声明JSX元素，通过reactDOM.render来更新DOM
const ele_two_ID = "ele_two"
const ele_two_item = "hello shaw"
const ele_one = <div>hello world</div>//最基础JSX语句
const ele_two = <div id={ele_two_ID}>{ele_two_item}</div>//JS表达式JSX语句
const element =(
    <div>
        {ele_one}
        {ele_two}
    </div>
)//内嵌子元素JSX语句

ReactDOM.render(element,document.getElementById("root"));
